Today I peacefully protested at the Statue of Liberty with Jewish Voice for Peace joining hundreds of other Jews and our allies calling for a ceasefire. The US government has sent billions of dollars in military aid to decimate Gaza and is sending more. We feel a responsibility to speak up and say “not in our name”: we do not believe military occupation will bring safety, and we cannot be silent while our government funds genocide. 10,000 civilians killed this month. “Never again” means never again for anyone. 

